import React from "react";
import "./GubangPage.css"

let listAllUrl = "https://admin.gbhome.com/api/v4/common/3in1/discovery?pageNum=1&pageSize=10";


class GubangPage extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className='GubangPage'>
                <h2>股帮，预期差就是生产力</h2>
                <div className="SubPage">
                    <GubangInfoList />
                </div>
            </div>
        )
    }
}

class GubangInfoList extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            data: []
        };
        this.getList()
    }

    async getList() {
        try {
            let response = await fetch(listAllUrl);
            let map = await response.json();
            console.log(map);
            this.setState({data: map["data"]["records"]})
        } catch(e) {
            console.log("Oops, error", e);
        }
    }

    render() {
        var listElements=[];
        this.state.data.forEach((record)=>{
            listElements.push(
                <p>
                    {record["title"]}<br/>
                    <div className='Snapshot'>
                        {record["content"]}<br/>
                    </div>
                </p>
            )
        });
        return (
            <div>
                {listElements}
            </div>
        );
    }
}

export default GubangPage;
